INSERT INTO `NOTICIA` (`NOTID`, `NOTTITULO`, `NOTFECHAPUBLICACION`, `NOTFECHAEDICION`, `NOTVISIBLE`, `NOTCONTENIDO`, `NOTIMAGEN`) VALUES
(14, 'Inscripciones abiertas para programas de posgrados', '2015-05-30 11:44:05', '2015-05-30 11:44:05', 1, 'La Universidad del Cauca, consciente de su compromiso con el país y la región frente a los procesos de mejoramiento de la calidad de la educación, y atendiendo aspectos importantes como la formación en valores, la formación para el trabajo y la productividad, el desarrollo del pensamiento y la generación y apropiación de ciencia y tecnología, ofrece programas de posgrado para el II Período Académico del año 2015', NULL),
(19, 'Foro por una educación sin sexismo ni racismo se desarrolla en Unicauca', '2015-10-18 11:45:10', '2015-10-18 11:45:10', 1, 'Durante la jornada pedagógica se reflexionó sobre una educación con enfoque diferencial e incluyente. Además, el escenario permitió dar a conocer experiencias que se desarrollan en diferentes grupos al interior del departamento.\r\n\r\n‘Palabras y experiencias’ es un ejercicio para pensar una formación en la que niñas y niños se reconozcan como sujetos de derecho, y en el que se trabaje por deshacer imaginarios negativos sobre lo que debería ser una mujer.\r\n\r\nLeidy Romero, del grupo de investigación SOMA, afirma que “Estos espacios son importantes ya que permiten crear conciencia de cuándo somos víctimas y cuándo ejercemos ese tipo de prácticas de exclusión”\r\n', NULL),
(30, 'En Unicauca finaliza evento internacional sobre seguridad y salud en el trabajo', '2015-10-18 15:45:34', '2015-10-18 15:45:34', 1, 'El Congreso, organizado por el Área de Salud Ocupacional y la organización Belisario Velásquez y Asociados LTDA., tuvo como propósito divulgar el conocimiento relacionado con los aspectos legales que enmarcan la Seguridad y Salud en el Trabajo. \r\n<div><br></div><div>“Tenemos total aceptación de las temáticas tratadas ya que son poco exploradas en Popayán y que esperamos seguir aportando en la formación de la comunidad”, indicó Diego Illera Rivera, jefe del Área de Salud Ocupacional, al referirse a la importancia de estos eventos. \r\n</div><div><br></div><div>La Alma Máter suscribió un convenio con la firma Belisario Velásquez y Asociados LTDA, con el fin, entre otras cosas, de realizar cinco versiones del Congreso que concluyó en la Institución en diferentes lugares del país.</div>', );
