(31, 'Monitor seleccionado en el proyecto InnovAcción Cauca para Diseño Gráfico (II Periodo Académico de 2015)', '2015-10-21 00:00:00', NULL, 0, 'El proyecto InnovAcción Cauca, con ID 3848 y ejecutado por la Universidad del Cauca, informa que el código del estudiante seleccionado en la 2da Convocatoria para una monitoría en Diseño Gráfico durante el II Periodo Académico de 2015 es 103411010740.<br><br>La selección del monitor se realizó con base en el informe de la División de Salud Integral, sobre la hoja de vida radicada en la oficina de InnovAcción Cauca y de la entrevista realizada.<br>', );
